'use strict';
const { ipcRenderer } = require('electron');

class MiniFrame {
  static init(){
    const $box = $('<div id="miniFrame"/>');
    const $boxx = $('<div />');
    const $close = $("<img />")
    const $maximize = $("<img />")
    const $unmaximize = $("<img />")
    const $minimize = $("<img />")
    const $settings = $("<img />")
    $close.attr('src','data:image/png;base64,')
    $close.on('click',()=>{
      ipcRenderer.send('miniFrame-close')
    })
    $maximize.attr('src','data:image/png;base64,')
    $maximize.on('click',()=>{
      $maximize.attr('style','display:none')
      $unmaximize.attr('style','')
      ipcRenderer.send('miniFrame-setFullScreen',true)
    })
    $unmaximize.attr('src','data:image/png;base64,')
    $unmaximize.attr('style','display:none')
    $unmaximize.on('click',()=>{
      $unmaximize.attr('style','display:none')
      $maximize.attr('style','')
      ipcRenderer.send('miniFrame-setFullScreen',false)
    })
    $minimize.attr('src','data:image/png;base64,')
    $minimize.on('click',()=>{
      ipcRenderer.send('miniFrame-minimize')
    })
    $settings.attr('src','data:image/png;base64,')
    $settings.on('click',()=>{
      ipcRenderer.send('open-settings-window')
    })
    $boxx.append($close);
    $boxx.append($maximize);
    $boxx.append($unmaximize);
    $boxx.append($minimize);
    $boxx.append($settings);
    $box.append($boxx)
    $(".header").prepend($box)
  }

}

module.exports = MiniFrame;
